import React from 'react';
import './App.css';
import {Button, Typography} from '@material-ui/core'

function App() {
  return (
    <div className="App">
      <Typography>
        Hello There
      </Typography>
      <Button variant="contained" color="tertiary">
        Button
      </Button>
    </div>
  );
}

export default App;
